def _reset_cacher(self) -> None:
    """Reset the cacher."""
    if hasattr(self, '_cacher'):
        del self._cacher

@property
def _is_cached(self) -> bool_t:
    """Return boolean indicating if self is cached or not."""
    return getattr(self, '_cacher', None) is not None

def _get_cacher(self):
    """return my cacher or None"""
    cacher = getattr(self, '_cacher', None)
    if cacher is not None:
        cacher = cacher[1]()
    return cacher

def _maybe_update_cacher(self, clear: bool_t=False, verify_is_copy: bool_t=True) -> None:
    """
    See if we need to update our parent cacher if clear, then clear our
    cache.

    Parameters
    ----------
    clear : bool, default False
        Clear the item cache.
    verify_is_copy : bool, default True
        Provide is_copy checks.
    """
    cacher = getattr(self, '_cacher', None)
    if cacher is not None:
        ref = cacher[1]()
        if ref is None:
            del self._cacher
        else:
            try:
                ref._maybe_cache_changed(cacher[0], self)
            except AssertionError:
                pass
    if verify_is_copy:
        self._check_setitem_copy(stacklevel=5, t='referant')
    if clear:
        self._clear_item_cache()

def _iget_item_cache(self, item):
    """Return the cached item, item represents a positional indexer."""
    ax = self._info_axis
    if ax.is_unique:
        lower = self._get_item_cache(ax[item])
    else:
        lower = self._take_with_is_copy(item, axis=self._info_axis_number)
    return lower

def _set_item(self, key, value) -> None:
    self._data.set(key, value)
    self._clear_item_cache()

def _set_is_copy(self, ref, copy: bool_t=True) -> None:
    if not copy:
        self._is_copy = None
    else:
        assert ref is not None
        self._is_copy = weakref.ref(ref)

def __delitem__(self, key) -> None:
    """
    Delete item
    """
    deleted = False
    maybe_shortcut = False
    if self.ndim == 2 and isinstance(self.columns, MultiIndex):
        try:
            maybe_shortcut = key not in self.columns._engine
        except TypeError:
            pass
    if maybe_shortcut:
        if not isinstance(key, tuple):
            key = (key,)
        for col in self.columns:
            if isinstance(col, tuple) and col[:len(key)] == key:
                del self[col]
                deleted = True
    if not deleted:
        self._data.delete(key)
    try:
        del self._item_cache[key]
    except KeyError:
        pass

@property
def _is_view(self):
    """Return boolean indicating if self is view of another array """
    return self._data.is_view

def drop(self, labels=None, axis=0, index=None, columns=None, level=None, inplace: bool_t=False, errors: str='raise'):
    inplace = validate_bool_kwarg(inplace, 'inplace')
    if labels is not None:
        if index is not None or columns is not None:
            raise ValueError("Cannot specify both 'labels' and 'index'/'columns'")
        axis_name = self._get_axis_name(axis)
        axes = {axis_name: labels}
    elif index is not None or columns is not None:
        axes, _ = self._construct_axes_from_arguments((index, columns), {})
    else:
        raise ValueError("Need to specify at least one of 'labels', 'index' or 'columns'")
    obj = self
    for axis, labels in axes.items():
        if labels is not None:
            obj = obj._drop_axis(labels, axis, level=level, errors=errors)
    if inplace:
        self._update_inplace(obj)
    else:
        return obj

def _needs_reindex_multi(self, axes, method, level) -> bool_t:
    """Check if we do need a multi reindex."""
    return com.count_not_none(*axes.values()) == self._AXIS_LEN and method is None and (level is None) and (not self._is_mixed_type)

def _reindex_with_indexers(self: FrameOrSeries, reindexers, fill_value=None, copy: bool_t=False, allow_dups: bool_t=False) -> FrameOrSeries:
    """allow_dups indicates an internal call here """
    new_data = self._data
    for axis in sorted(reindexers.keys()):
        index, indexer = reindexers[axis]
        baxis = self._get_block_manager_axis(axis)
        if index is None:
            continue
        index = ensure_index(index)
        if indexer is not None:
            indexer = ensure_int64(indexer)
        new_data = new_data.reindex_indexer(index, indexer, axis=baxis, fill_value=fill_value, allow_dups=allow_dups, copy=copy)
    if copy and new_data is self._data:
        new_data = new_data.copy()
    return self._constructor(new_data).__finalize__(self)

