        left = self._reindex_indexer(join_index, lidx, copy)
        right = other._reindex_indexer(join_index, ridx, copy)
    else:
        fdata = self._data
        if axis == 0:
            join_index = self.index
            lidx, ridx = (None, None)
            if not self.index.equals(other.index):
